import './App.css';
import { Form } from 'react-bootstrap';
import React, { useState } from 'react';

const axios = require('axios');


function App() {

  const [range, setRange] = useState(10);




  function handlePost() {

    const options = {
      method: 'POST',
      url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
      headers: { 'Content-type': 'application/json' },
      data: {
        laanebelop: 2000000,
        nominellRente: 3,
        terminGebyr: 30,
        utlopsDato: "2045-01-01",
        saldoDato: "2020-01-01",
        datoForsteInnbetaling: "2020-02-01",
        ukjentVerdi: "TERMINBELOP"

      }
    }


    axios(options).then(function (response) {
      console.log(response)
    }).catch(function (error) {
      console.log(error);
    });

  }


  return (
    <div className="App">
      <div className="App-header">
        Lånekalkulator
    </div>
      <div className="App-Laanekalkulator">
        <Form>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" min="0" max="300000" value={range} onChange={e => setRange(e.target.value)} />
          </Form.Group>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" />
          </Form.Group>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" />
          </Form.Group>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" />
          </Form.Group>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" />
          </Form.Group>
          <Form.Group controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <Form.Control type="range" />
          </Form.Group>
        </Form>
      </div>


    </div>
  );
}

export default App;
